import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { Tenant } from '../types/tenant';
import { tenantService } from '../services/tenantService';
import { leaseService } from '../services/leaseService';
import TenantEditModal from '../components/Tenants/TenantEditModal';
import toast from 'react-hot-toast';
import {
  ArrowLeftIcon,
  UserIcon,
  EnvelopeIcon,
  PhoneIcon,
  MapPinIcon,
  BriefcaseIcon,
  CurrencyDollarIcon,
  CalendarIcon,
  DocumentTextIcon,
  PencilIcon,
  HomeIcon,
  BanknotesIcon,
  ClockIcon,
  CheckCircleIcon,
  ExclamationTriangleIcon
} from '@heroicons/react/24/outline';

interface TenantLease {
  id: string;
  propertyId?: string;
  property_id?: string;
  tenant_id?: string;
  tenantId?: string;
  property_name?: string;
  property_address?: string;
  startDate?: string;
  start_date?: string;
  endDate?: string;
  end_date?: string;
  monthlyRent?: number;
  monthly_rent?: number;
  rent_amount?: number;
  status?: string;
  created_at?: string;
}

const TenantDetail: React.FC = () => {
  const { tenantId } = useParams<{ tenantId: string }>();
  const navigate = useNavigate();
  const [tenant, setTenant] = useState<Tenant | null>(null);
  const [leases, setLeases] = useState<TenantLease[]>([]);
  const [loading, setLoading] = useState(true);
  const [activeTab, setActiveTab] = useState('overview');
  const [isEditModalOpen, setIsEditModalOpen] = useState(false);

  useEffect(() => {
    if (tenantId) {
      fetchTenantData();
    }
  }, [tenantId]);

  const fetchTenantData = async () => {
    try {
      setLoading(true);

      // Fetch tenant details
      const tenantData = await tenantService.getTenant(tenantId!);
      setTenant(tenantData);

      // Fetch tenant's leases
      const leasesData = await leaseService.getLeases();
      const tenantLeases = leasesData.filter((lease: any) => 
        lease.tenant_id === tenantId || lease.tenantId === tenantId
      );
      setLeases(tenantLeases);

    } catch (error) {
      console.error('Error fetching tenant data:', error);
      toast.error('Failed to load tenant details');
    } finally {
      setLoading(false);
    }
  };

  const handleEditSubmit = async (data: Partial<Tenant>) => {
    try {
      if (!tenant?.id) return;

      await tenantService.updateTenant(data as any);
      toast.success('Tenant updated successfully!');

      // Refresh tenant data
      await fetchTenantData();
      setIsEditModalOpen(false);
    } catch (error) {
      console.error('Error updating tenant:', error);
      toast.error('Failed to update tenant');
      throw error;
    }
  };

  const getStatusColor = (status: string) => {
    switch (status?.toLowerCase()) {
      case 'active':
        return 'bg-green-100 text-green-800';
      case 'inactive':
        return 'bg-gray-100 text-gray-800';
      case 'pending':
        return 'bg-yellow-100 text-yellow-800';
      case 'evicted':
        return 'bg-red-100 text-red-800';
      default:
        return 'bg-gray-100 text-gray-800';
    }
  };

  const getLeaseStatusColor = (status: string) => {
    switch (status?.toLowerCase()) {
      case 'active':
        return 'bg-green-100 text-green-800';
      case 'pending':
        return 'bg-yellow-100 text-yellow-800';
      case 'expired':
        return 'bg-red-100 text-red-800';
      case 'terminated':
        return 'bg-gray-100 text-gray-800';
      default:
        return 'bg-gray-100 text-gray-800';
    }
  };

